import { useState } from 'react';
import {
  Container,
  Typography,
  Box,
  Grid,
  Card,
  CardContent,
  CardMedia,
  Chip,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  IconButton,
} from '@mui/material';
import { motion } from 'framer-motion';
import CloseIcon from '@mui/icons-material/Close';

interface Project {
  id: number;
  title: string;
  description: string;
  image: string;
  technologies: string[];
  demo: string;
  detailImages: string[];
  myPart: string;
}

const projects: Project[] = [
  {
    id: 1,
    title: '포트폴리오 웹사이트',
    description: 'React와 TypeScript를 사용한 개인 포트폴리오 웹사이트입니다.',
    image: '/img/portfolio.jpg',
    technologies: ['React', 'TypeScript', 'Material-UI', 'Framer Motion'],
    demo: 'https://example.com/portfolio',
    detailImages: ['/img/portfolio1.jpg', '/img/portfolio2.jpg', '/img/portfolio3.jpg'],
    myPart: '전체 개발 및 디자인을 담당했습니다. React와 TypeScript를 사용하여 모던한 UI/UX를 구현했으며, Material-UI를 활용하여 반응형 디자인을 적용했습니다.'
  },
  {
    id: 2,
    title: '쇼핑몰 프로젝트',
    description: 'Spring Boot와 React를 사용한 풀스택 쇼핑몰 프로젝트입니다.',
    image: '/img/shopping.jpg',
    technologies: ['Spring Boot', 'React', 'MySQL', 'AWS'],
    demo: 'https://example.com/shopping',
    detailImages: ['/img/shopping1.jpg', '/img/shopping2.jpg', '/img/shopping3.jpg'],
    myPart: '백엔드 API 개발을 담당했습니다. Spring Boot를 사용하여 RESTful API를 구현했으며, MySQL 데이터베이스 설계 및 AWS 배포를 진행했습니다.'
  },
  {
    id: 3,
    title: '소셜 미디어 앱',
    description: '실시간 채팅과 게시물 공유 기능이 있는 소셜 미디어 애플리케이션입니다.',
    image: '/img/social.jpg',
    technologies: ['Node.js', 'React', 'Socket.io', 'MongoDB'],
    demo: 'https://example.com/social',
    detailImages: ['/img/social1.jpg', '/img/social2.jpg', '/img/social3.jpg'],
    myPart: '실시간 채팅 기능 개발을 담당했습니다. Socket.io를 사용하여 실시간 통신을 구현했으며, MongoDB를 활용하여 데이터를 저장하고 관리했습니다.'
  },
];

const Projects = () => {
  const [selectedProject, setSelectedProject] = useState<Project | null>(null);

  const handleOpenDialog = (project: Project) => {
    setSelectedProject(project);
  };

  const handleCloseDialog = () => {
    setSelectedProject(null);
  };

  const handleDemoClick = (url: string) => {
    window.open(url, '_blank', 'width=800,height=600');
  };

  return (
    <Container maxWidth="lg">
      <Box sx={{ my: 4 }}>
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          <Typography
            variant="h2"
            component="h1"
            gutterBottom
            align="center"
            sx={{
              mb: 2,
              background: 'linear-gradient(45deg, #6366f1 30%, #ec4899 90%)',
              backgroundClip: 'text',
              textFillColor: 'transparent',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
            }}
          >
            프로젝트
          </Typography>
          <Typography
            variant="h5"
            color="text.secondary"
            paragraph
            align="center"
            sx={{ mb: 8, maxWidth: '800px', mx: 'auto' }}
          >
            제가 작업한 주요 프로젝트들을 소개합니다
          </Typography>
        </motion.div>

        <Grid container spacing={4}>
          {projects.map((project, index) => (
            <Grid item xs={12} md={4} key={project.id}>
              <motion.div
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: index * 0.2 }}
              >
                <Card
                  sx={{
                    height: '100%',
                    display: 'flex',
                    flexDirection: 'column',
                    bgcolor: 'background.paper',
                    borderRadius: '16px',
                    border: '1px solid rgba(255, 255, 255, 0.1)',
                    transition: 'transform 0.3s ease-in-out',
                    '&:hover': {
                      transform: 'translateY(-8px)',
                    },
                  }}
                >
                  <CardMedia
                    component="img"
                    height="200"
                    image={project.image}
                    alt={project.title}
                    sx={{ objectFit: 'cover' }}
                  />
                  <CardContent sx={{ flexGrow: 1 }}>
                    <Typography variant="h5" component="h2" gutterBottom>
                      {project.title}
                    </Typography>
                    <Typography color="text.secondary" paragraph>
                      {project.description}
                    </Typography>
                    <Box sx={{ mb: 2 }}>
                      {project.technologies.map((tech) => (
                        <Chip
                          key={tech}
                          label={tech}
                          size="small"
                          sx={{
                            mr: 1,
                            mb: 1,
                            bgcolor: 'rgba(99, 102, 241, 0.1)',
                            color: 'primary.main',
                          }}
                        />
                      ))}
                    </Box>
                    <Button
                      variant="contained"
                      onClick={() => handleDemoClick(project.demo)}
                      sx={{ mr: 1 }}
                    >
                      데모 보기
                    </Button>
                    <Button
                      variant="outlined"
                      onClick={() => handleOpenDialog(project)}
                    >
                      상세 보기
                    </Button>
                  </CardContent>
                </Card>
              </motion.div>
            </Grid>
          ))}
        </Grid>
      </Box>

      <Dialog
        open={!!selectedProject}
        onClose={handleCloseDialog}
        maxWidth="md"
        fullWidth
      >
        {selectedProject && (
          <>
            <DialogTitle>
              {selectedProject.title}
              <IconButton
                onClick={handleCloseDialog}
                sx={{ position: 'absolute', right: 8, top: 8 }}
              >
                <CloseIcon />
              </IconButton>
            </DialogTitle>
            <DialogContent>
              <Grid container spacing={2} sx={{ mt: 1 }}>
                {selectedProject.detailImages.map((image, index) => (
                  <Grid item xs={12} md={4} key={index}>
                    <img
                      src={image}
                      alt={`${selectedProject.title} 상세 이미지 ${index + 1}`}
                      style={{ width: '100%', borderRadius: '8px' }}
                    />
                  </Grid>
                ))}
              </Grid>
              <Box sx={{ mt: 3 }}>
                <Typography variant="h6" gutterBottom>
                  담당 파트
                </Typography>
                <Typography color="text.secondary">
                  {selectedProject.myPart}
                </Typography>
              </Box>
            </DialogContent>
            <DialogActions>
              <Button onClick={handleCloseDialog}>닫기</Button>
            </DialogActions>
          </>
        )}
      </Dialog>
    </Container>
  );
};

export default Projects;
